ll compute0(ll mn, ll mx)
{
    mn = max(mn, 1LL);
    ll ret = 0;
    for(ll i = 2; i * i <= mx; i++) {
        ll k = i*i;
        ll start = mn / k;
        if(start * k < mn) start++;
        start *= k;
        while(start <= mx) {
            if(!chk[start - mn]) {
                chk[start - mn] = true;
                ret++;
            }
            start += k;
        }
    }

    for(ll i = 2; i * i <= mx; i++) {
        ll k = i*i;
        ll start = mn / k;
        if(start * k < mn) start++;
        start *= k;
        while(start <= mx) {
            chk[start - mn] = false;
            start += k;
        }
    }
    return ret;
}

inline ll compute(ll x)
{
    ll ret = 0;
    ll idx = x / B;
    ret += cache[idx];
    ret += compute0(idx * B, x);
    return ret;
}

